const LoginForm = () => {
    return (
      <div className={loginpageC.container}>
        <h2>로그인</h2>
        <form className={loginpageC.form}>
          <label htmlFor="username" className={loginpageC.label}>
            사용자 이름:
          </label>
          <input
            type="text"
            id="username"
            className={loginpageC.input}
            // Rest of the input attributes
          />
          {/* Rest of the form elements */}
          <button type="submit" className={loginpageC.button}>
            로그인
          </button>
        </form>
      </div>
    );
  };
